webpackJsonp([7460197418580],{929:function(e,t){e.exports={data:{site:{siteMetadata:{docSections:{basics:["/basics/introduction/","/basics/writing-stories/","/basics/exporting-storybook/","/basics/faq/","/basics/live-examples/"],guides:["/guides/quick-start-guide/","/guides/slow-start-guide/","/guides/guide-html/","/guides/guide-react/","/guides/guide-react-native/","/guides/guide-vue/","/guides/guide-angular/","/guides/guide-mithril/","/guides/guide-marko/","/guides/guide-ember/","/guides/guide-riot/","/guides/guide-svelte/","/guides/guide-preact/"],configurations:["/configurations/overview/","/configurations/options-parameter/","/configurations/default-config/","/configurations/custom-webpack-config/","/configurations/custom-babel-config/","/configurations/typescript-config/","/configurations/add-custom-head-tags/","/configurations/add-custom-body/","/configurations/serving-static-files/","/configurations/env-vars/","/configurations/theming/","/configurations/cli-options/","/configurations/standalone-options/"],formats:["/formats/component-story-format/","/formats/storiesof-api/","/formats/mdx-syntax/"],testing:["/testing/react-ui-testing/","/testing/structural-testing/","/testing/interaction-testing/","/testing/automated-visual-testing/","/testing/manual-testing/"],addons:["/addons/introduction/","/addons/using-addons/","/addons/writing-addons/","/addons/api/"],presets:["/presets/introduction/","/presets/preset-gallery/","/presets/writing-presets/"]}}},allMarkdownRemark:{edges:[{node:{fields:{slug:"/configurations/add-custom-head-tags/"},frontmatter:{title:"Add Custom Head Tags",id:"add-custom-head-tags"}}},{node:{fields:{slug:"/configurations/add-custom-body/"},frontmatter:{title:"Add Custom Body",id:"add-custom-body"}}},{node:{fields:{slug:"/configurations/custom-postcss-config/"},frontmatter:{title:"Custom Postcss Config",id:"custom-postcss-config"}}},{node:{fields:{slug:"/404/"},frontmatter:{title:"",id:null}}},{node:{fields:{slug:"/configurations/cli-options/"},frontmatter:{title:"CLI Options",id:"cli-options"}}},{node:{fields:{slug:"/configurations/custom-babel-config/"},frontmatter:{title:"Custom Babel Config",id:"custom-babel-config"}}},{node:{fields:{slug:"/configurations/env-vars/"},frontmatter:{title:"Using Environment Variables",id:"env-vars"}}},{node:{fields:{slug:"/configurations/default-config/"},frontmatter:{title:"Default Config",id:"default-config"}}},{node:{fields:{slug:"/configurations/options-parameter/"},frontmatter:{title:"Options Parameter",id:"options-parameter"}}},{node:{fields:{slug:"/configurations/serving-static-files/"},frontmatter:{title:"Serving Static Files",id:"serving-static-files"}}},{node:{fields:{slug:"/configurations/standalone-options/"},frontmatter:{title:"Standalone Options",id:"standalone-options"}}},{node:{fields:{slug:"/configurations/overview/"},frontmatter:{title:"Configuration overview",id:"overview"}}},{node:{fields:{slug:"/configurations/theming/"},frontmatter:{title:"Theming Storybook",id:"theming"}}},{node:{fields:{slug:"/basics/faq/"},frontmatter:{title:"Frequently Asked Questions",id:"faq"}}},{node:{fields:{slug:"/basics/exporting-storybook/"},frontmatter:{title:"Exporting Storybook as a Static App",id:"exporting-storybook"}}},{node:{fields:{slug:"/basics/community/"},frontmatter:{title:"Community",id:"community"}}},{node:{fields:{slug:"/addons/using-addons/"},frontmatter:{title:"Using Addons",id:"using-addons"}}},{node:{fields:{slug:"/basics/introduction/"},frontmatter:{title:"Introduction",id:"introduction"}}},{node:{fields:{slug:"/basics/live-examples/"},frontmatter:{title:"Live Examples",id:"live-examples"}}},{node:{fields:{slug:"/basics/toolbar-guide/"},frontmatter:{title:"Toolbar",id:"toolbar-guide"}}},{node:{fields:{slug:"/formats/component-story-format/"},frontmatter:{title:"Component Story Format (CSF)",id:"component-story-format"}}},{node:{fields:{slug:"/formats/mdx-syntax/"},frontmatter:{title:"MDX Syntax",id:"mdx-syntax"}}},{node:{fields:{slug:"/guides/guide-angular/"},frontmatter:{title:"Storybook for Angular",id:"guide-angular"}}},{node:{fields:{slug:"/formats/storiesof-api/"},frontmatter:{title:"StoriesOf API",id:"storiesof-api"}}},{node:{fields:{slug:"/addons/introduction/"},frontmatter:{title:"Intro to Addons",id:"introduction"}}},{node:{fields:{slug:"/guides/guide-html/"},frontmatter:{title:"Storybook for HTML",id:"guide-html"}}},{node:{fields:{slug:"/guides/guide-mithril/"},frontmatter:{title:"Storybook for Mithril",id:"guide-mithril"}}},{node:{fields:{slug:"/guides/guide-marko/"},frontmatter:{title:"Storybook for Marko",id:"guide-marko"}}},{node:{fields:{slug:"/guides/guide-ember/"},frontmatter:{title:"Storybook for Ember",id:"guide-ember"}}},{node:{fields:{slug:"/guides/guide-rax/"},frontmatter:{title:"Storybook for Rax",id:"guide-rax"}}},{node:{fields:{slug:"/guides/guide-react-native/"},frontmatter:{title:"Storybook for React Native",id:"guide-react-native"}}},{node:{fields:{slug:"/guides/guide-preact/"},frontmatter:{title:"Storybook for Preact",id:"guide-preact"}}},{node:{fields:{slug:"/guides/guide-riot/"},frontmatter:{title:"Storybook for Riot",id:"guide-riot"}}},{node:{fields:{slug:"/guides/guide-react/"},frontmatter:{title:"Storybook for React",id:"guide-react"}}},{node:{fields:{slug:"/guides/guide-vue/"},frontmatter:{title:"Storybook for Vue",id:"guide-vue"}}},{node:{fields:{slug:"/guides/guide-svelte/"},frontmatter:{title:"Storybook for Svelte",id:"guide-svelte"}}},{node:{fields:{slug:"/guides/quick-start-guide/"},frontmatter:{title:"Quick Start Guide",id:"quick-start-guide"}}},{node:{fields:{slug:"/presets/preset-gallery/"},frontmatter:{title:"Preset Gallery",id:"preset-gallery"}}},{node:{fields:{slug:"/presets/writing-presets/"},frontmatter:{title:"Writing Presets",id:"writing-presets"}}},{node:{fields:{slug:"/guides/slow-start-guide/"},frontmatter:{title:"Slow Start Guide",id:"slow-start-guide"}}},{node:{fields:{slug:"/testing/manual-testing/"},frontmatter:{title:"Manual Testing",id:"manual-testing"}}},{node:{fields:{slug:"/testing/react-ui-testing/"},frontmatter:{title:"Introduction: React UI Testing",id:"react-ui-testing"}}},{node:{fields:{slug:"/presets/introduction/"},frontmatter:{title:"Intro to Presets",id:"introduction"}}},{node:{fields:{slug:"/testing/interaction-testing/"},frontmatter:{title:"Interaction Testing",id:"interaction-testing"}}},{node:{fields:{slug:"/testing/structural-testing/"},frontmatter:{title:"Structural Testing",id:"structural-testing"}}},{node:{fields:{slug:"/configurations/custom-webpack-config/"},frontmatter:{title:"Custom Webpack Config",id:"custom-webpack-config"}}},{node:{fields:{slug:"/configurations/typescript-config/"},frontmatter:{title:"TypeScript Config",id:"typescript-config"}}},{node:{fields:{slug:"/addons/addon-gallery/"},frontmatter:{title:"Addon Gallery",id:"addon-gallery"}}},{node:{fields:{slug:"/addons/writing-addons/"},frontmatter:{title:"Writing Addons",id:"writing-addons"}}},{node:{fields:{slug:"/addons/api/"},frontmatter:{title:"API",id:"api"}}},{node:{fields:{slug:"/basics/writing-stories/"},frontmatter:{title:"Writing Stories",id:"writing-stories"}}},{node:{fields:{slug:"/testing/automated-visual-testing/"},frontmatter:{title:"Automated Visual Testing",id:"automated-visual-testing"}}}]},markdownRemark:{html:'<p>Let’s learn about the default config that comes with Storybook.</p>\n<h2 id="babel"><a href="#babel" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Babel</h2>\n<p>We use Babel for JavaScript(ES6) transpiling.\nHere are some key features of Storybook’s Babel configurations.</p>\n<h3 id="es2016-support"><a href="#es2016-support" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>ES2016+ Support</h3>\n<p>We have added ES2016 support with Babel for transpiling your JS code.\nIn addition to that, we’ve added a few experimental features, like object spreading and async await.\nCheck out our <a href="https://github.com/storybookjs/storybook/blob/master/lib/core/src/server/common/babel.js">source</a> to learn more about these plugins.</p>\n<h3 id="babelrc-support"><a href="#babelrc-support" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>.babelrc support</h3>\n<p>If your project has a <code>.babelrc</code> file, we’ll use that instead of the default config file.\nSo, you could use any babel plugins or presets that you have used in your project with Storybook.</p>\n<h2 id="webpack"><a href="#webpack" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Webpack</h2>\n<p>We use Webpack to serve and load JavaScript modules for the web.</p>\n<p>The webpack config <a href="/docs/configurations/custom-webpack-config/">is configurable</a>, and the default can depend on which framework you’re using and whether you’ve used a generator like <a href="https://github.com/facebookincubator/create-react-app">Create React App</a> or Angular CLI etc.</p>\n<blockquote>\n<p>We’re trying to make storybook more zero-config over time, <strong>help to hook into the config of generators is very welcome</strong>.</p>\n</blockquote>\n<details>\n  <summary>This is what the config for storybook looks like when using CRA in dev-mode:</summary>\n<pre><code class="language-js">{\n  mode: \'development\',\n  bail: false,\n  devtool: \'#cheap-module-source-map\',\n  entry: [\n    \'@storybook/core/dist/server/common/polyfills.js\',\n    \'@storybook/core/dist/server/preview/globals.js\',\n    \'&#x3C;your-storybook-dir>/preview.js\',\n    \'webpack-hot-middleware/client.js?reload=true\',\n  ],\n  output: {\n    path: \'./\',\n    filename: \'[name].[hash].bundle.js\',\n    publicPath: \'\',\n  },\n  plugins: [\n    HtmlWebpackPlugin {\n      options: {\n        template: \'@storybook/core/dist/server/templates/index.ejs\',\n        templateContent: false,\n        templateParameters: [Function: templateParameters],\n        filename: \'iframe.html\',\n        hash: false,\n        inject: false,\n        compile: true,\n        favicon: false,\n        minify: undefined,\n        cache: true,\n        showErrors: true,\n        chunks: \'all\',\n        excludeChunks: [],\n        chunksSortMode: \'none\',\n        meta: {},\n        title: \'Webpack App\',\n        xhtml: false,\n        alwaysWriteToDisk: true,\n      },\n    },\n    DefinePlugin {\n      definitions: {\n        \'process.env\': {\n          NODE_ENV: \'"development"\',\n          NODE_PATH: \'""\',\n          PUBLIC_URL: \'"."\',\n          \'&#x3C;storybook-environment-variables>\'\n          \'&#x3C;dotenv-environment-variables>\'\n        },\n      },\n    },\n    WatchMissingNodeModulesPlugin {\n      nodeModulesPath: \'./node_modules\',\n    },\n    HotModuleReplacementPlugin {},\n    CaseSensitivePathsPlugin {},\n    ProgressPlugin {},\n    DefinePlugin {\n      definitions: {\n        \'&#x3C;storybook-environment-variables>\'\n        \'&#x3C;dotenv-environment-variables>\'\n      },\n    },\n  ],\n  module: {\n    rules: [\n      { test: /\\.(mjs|jsx?)$/,\n        use: [\n          { loader: \'babel-loader\', options:\n            { cacheDirectory: \'./node_modules/.cache/storybook\',\n              presets: [\n                [ \'./node_modules/@babel/preset-env/lib/index.js\', { shippedProposals: true, useBuiltIns: \'usage\', corejs: \'3\' } ],\n                \'./node_modules/@babel/preset-react/lib/index.js\',\n                \'./node_modules/@babel/preset-flow/lib/index.js\',\n              ],\n              plugins: [\n                \'./node_modules/@babel/plugin-proposal-object-rest-spread/lib/index.js\',\n                \'./node_modules/@babel/plugin-proposal-class-properties/lib/index.js\',\n                \'./node_modules/@babel/plugin-syntax-dynamic-import/lib/index.js\',\n                [ \'./node_modules/babel-plugin-emotion/dist/babel-plugin-emotion.cjs.js\', { sourceMap: true, autoLabel: true } ],\n                \'./node_modules/babel-plugin-macros/dist/index.js\',\n                \'./node_modules/@babel/plugin-transform-react-constant-elements/lib/index.js\',\n                \'./node_modules/babel-plugin-add-react-displayname/index.js\',\n                [ \'./node_modules/babel-plugin-react-docgen/lib/index.js\', { DOC_GEN_COLLECTION_NAME: \'STORYBOOK_REACT_CLASSES\' } ],\n              ],\n            },\n          },\n        ],\n        include: [ \'./\' ],\n        exclude: [ \'./node_modules\' ],\n      },\n      { test: /\\.md$/,\n        use: [\n          { loader: \'./node_modules/raw-loader/index.js\' },\n        ],\n      },\n      { test: /\\.css$/,\n        use: [\n          \'./node_modules/style-loader/index.js\',\n          { loader: \'./node_modules/css-loader/dist/cjs.js\', options: { importLoaders: 1 } },\n          { loader: \'./node_modules/postcss-loader/src/index.js\', options: { ident: \'postcss\', postcss: {}, plugins: [Function: plugins] } },\n        ],\n      },\n      { test: /\\.(svg|ico|jpg|jpeg|png|gif|eot|otf|webp|ttf|woff|woff2|cur|ani)(\\?.*)?$/,\n        loader: \'./node_modules/file-loader/dist/cjs.js\',\n        query: { name: \'static/media/[name].[hash:8].[ext]\' },\n      },\n      { test: /\\.(mp4|webm|wav|mp3|m4a|aac|oga)(\\?.*)?$/,\n        loader: \'./node_modules/url-loader/dist/cjs.js\',\n        query: { limit: 10000, name: \'static/media/[name].[hash:8].[ext]\' },\n      },\n    ],\n  },\n  resolve: {\n    extensions: [ \'.mjs\', \'.js\', \'.jsx\', \'.json\' ],\n    modules: [ \'node_modules\' ],\n    mainFields: [ \'browser\', \'main\', \'module\' ],\n    alias: {\n      \'core-js\': \'./node_modules/core-js\',\n      react: \'./node_modules/react\',\n      \'react-dom\': \'./node_modules/react-dom\',\n    },\n  },\n  optimization: {\n    splitChunks: { chunks: \'all\' },\n    runtimeChunk: true,\n    minimizer: [ [Object] ],\n  },\n  performance: { hints: false },\n}\n</code></pre>\n</details>\n<h3 id="css-support"><a href="#css-support" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>CSS Support</h3>\n<p>You can import CSS files wherever you want, whether it’s in the storybook config file, a UI component, or inside a story definition file.</p>\n<p>Basically, you can import CSS like this:</p>\n<pre><code class="language-js">// from NPM modules\nimport \'bootstrap/dist/css/bootstrap.css\';\n\n// from local path\nimport \'./styles.css\';\n</code></pre>\n<blockquote>\n<p><strong>Note:</strong> with some frameworks/clis we inject plain CSS only. If you need a preprocessor like SASS, you need to <a href="/docs/configurations/custom-webpack-config/">customize the webpack config</a>.</p>\n<p><strong>Warning:</strong> storybooks for projects that use Angular CLI cannot import CSS by default. They must either <a href="/docs/configurations/custom-webpack-config/">customize the webpack config</a>, or use the inline loader syntax:</p>\n<pre><code class="language-js">import \'!style-loader!css-loader!./styles.css\';\n</code></pre>\n</blockquote>\n<h3 id="image-and-static-file-support"><a href="#image-and-static-file-support" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Image and Static File Support</h3>\n<p>You can also import images and media files directly via JavaScript.\nThis helps you to write stories with media files. This is how to do it:</p>\n<pre><code class="language-js">import React from \'react\';\nimport { storiesOf } from \'@storybook/react\';\n\nimport imageFile from \'./static/image.png\';\n\nstoriesOf(\'&#x3C;img />\', module)\n  .add(\'with an image\', () => (\n    &#x3C;img src={imageFile} alt="covfefe" />\n  ));\n</code></pre>\n<p>When you are building a storybook, we’ll also export the imported image.\nSo, this is a good approach to loading all of your static content.</p>\n<blockquote>\n<p><strong>Alternative:</strong> storybook also has a way to mention static directories via the <code>-s</code> option of the <code>start-storybook</code> and <code>build-storybook</code> commands. <a href="/docs/configurations/serving-static-files/">read more</a></p>\n</blockquote>\n<h3 id="json-loader"><a href="#json-loader" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>JSON Loader</h3>\n<p>You can import <code>.json</code> files, as you do with Node.js.\nThis will also allow you to use NPM projects that import <code>.json</code> files inside them.</p>\n<pre><code class="language-js">import React from \'react\';\nimport { storiesOf } from \'@storybook/react\';\n\nimport data from \'./data.json\';\n\nstoriesOf(\'Component\', module)\n  .add(\'with data\', () => (\n    &#x3C;pre>{JSON.stringify(data, null, 2)}&#x3C;/pre>\n  ));\n</code></pre>\n<h2 id="npm-modules"><a href="#npm-modules" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>NPM Modules</h2>\n<p>You can use any of the NPM modules installed on your project.\nYou can import and use them.</p>',fields:{slug:"/configurations/default-config/"},frontmatter:{title:"Default Config",id:"default-config"}}},pathContext:{slug:"/configurations/default-config/"}}}});
//# sourceMappingURL=path---configurations-default-config-bf562bfc734a9528133c.js.map